import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import SignIn from "./SignIn";
import App from "./App";

function Switcher() {

    return (
        <Router>
        <Switch>
            <Route path="/" exact component={App}/>}/>
        </Switch>
        </Router>
    );
}

export default Switcher;
